import React from 'react';
import './NotFound.css'; 

const NotFound = () => {
  return (
    <div className="not-found">
      <h1>404 Error</h1>
      <p>Oops! The page you are looking for does not exist.</p>
    </div>
  );
}

export default NotFound;
